import React, {Fragment} from 'react';

class Library extends React.Component {
    render() {
        return(
            <Fragment>
                <div className='library'>
                    <ul>
                        <li className='link'><a href="">Canciones</a></li>
                        <li className='link'><a href="">Albums</a></li>
                        <li className='link'><a href="">Artistas</a></li>
                    </ul> 
                </div>
            </Fragment>
        );
    }
}

export default Library;
